import Button from "./Button";
import styles from "./App.module.css";
import { useState } from "react";

function App() {
  const [counter, setCounter] = useState(0);
  function onClick() {
    return setCounter((a) => a + 1);
  }

  return (
    <div>
      <h1 className={styles.title}>{counter}</h1>
      <Button text="Click me!" />
    </div>
  );
}

export default App;
